// Columns.js
import React from "react";

const Columns = () => {
  return [
    {
      Header: "Name",
      accessor: "name",
      sortable: true,
      show: true,
      displayValue: "First Name",
    },
    {
      Header: "DOI",
      accessor: "doi",
      sortable: true,
      show: true,
      displayValue: "Status",
    },
    {
      Header: "New DOI",
      accessor: "doi",
      sortable: true,
      show: true,
      displayValue: "Status",
      Cell: ({ value }) => (
        <a
          href={`https://doi.org/${value}`}
          target="_blank"
          rel="noopener noreferrer"
        >
          {`https://doi.org/${value}`}
        </a>
      ),
    },
  ];
};

export default Columns;
